INSERT INTO `products` (`id`, `title`, `description`, `price`, `image`, `category`, `store`) VALUES
(867, 'Babilla vaca vacío', 'Parte situada en la cara interior del muslo y tiene forma de ovoide. Se divide en dos partes, la primera parte es una zona que está más cercana a la cadera, lo que hace que esta sea más tierna y jugosa, ideal para filetes;  la otra parte está cercana a la rodilla, por lo que es una carne un poco más dura, la cual se recomienda utilizar en preparaciones de cocción larga como lo son los guisos.', '11,95 €', 'https://cdn.metro-group.com/es/es_pim_217553001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(868, 'Lomo alto novillo argentino al vacío precio Kg', 'Novillo Argentino :Criados en praderas de la Pampa, es una de las mejores carnes del mundo, con una jugosidad, terneza y suavidad extraordinarias.', '31,95 €', 'https://cdn.metro-group.com/es/es_pim_141623001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(869, 'Chuleta de cordero lechal de Riaza bandeja 1,5kg', 'Chuleta de cordero lechal de Riaza bandeja 1,5kg. En Muñoz Berzal Hermanos contamos con una amplia variedad de productos frescos y congelados que podrá conseguir en Riaza, donde nos encontramos.', '24,95 €', 'https://cdn.metro-group.com/es/es_pim_50101001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(870, 'Pechuga de pollo bolsa 2,5kg precio kg', 'Pechuga de pollo. Se presenta en envase 2,5kg aprox. Pieza de pechuga de pollo de 2,5kg al por mayor al mejor precio con posibilidad de distintos cortes y elaboraciones para tu negocio de hostelería. Con esta pechuga de pollo tienes la opción de filetearla y cocinarla a la plancha, hacer la pieza entera al horno, cortarlo para hacer pinchitos, utilizarlo en platos combinados y un sinfín de posibilidades más. Esta carne de pollo destaca por ser tierna y jugosa.', '5,65 €', 'https://cdn.metro-group.com/es/es_pim_102160001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(871, 'METRO Chef torrezno de soria 1,7 kg bandeja', 'Se presenta en envase 1,700kg. Producto de alta calidad ,valorado y premiado como el mejor torrezno del mundo. Tiene exclusividad de la marca propia METROCHEF. El envase es el apropiado para el tipo del producto que envasamos. Actualmente el producto posee marca de garantia y en breve cambiara a la certificacion IGP. El producto se elabora de forma artesanal, lo que nos permite conseguir un sabor que nos hace diferentes al resto de los competidores. Todos los procesos se hacen de forma artesanal. El envase que utilizamos, nos permite garantizar que la merma del producto es del 0% desde el envase hasta la fecha de consumo. Normalmente se regenera sumergido en aiceite caliente, aunque tambien nos permite darle una terminacion perfecta en una freidora airfyre. Facil y rapida elaboracion ,terminacion perfecta en minutos y sabor unico y diferente.', '26,45 €', 'https://cdn.metro-group.com/es/es_pim_221584001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(872, 'METRO Chef solomillo vaca 2,8-3,2 kg kg al vacio', 'makro Chef es la Marca Makro en la que encontrarás todos los productos esenciales  para el uso diario en restaurantes y bares, desde productos frescos como verdura, carne o pescado; hasta lácteos, quesos, ahumados, conservas o aperitivos.', '28,95 €', 'https://cdn.metro-group.com/es/es_pim_211649001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(873, 'METRO Chef lomo bajo vaca 1/2 pz al vacio', 'Lomo bajo de vaca al por mayor envasado al vacío. Media pieza de aproximadamente 3,5kg de carne de entrecot de vaca fresco y jugoso para hostelería. El lomo bajo es la parte trasera, que ofrece una carne jugosa, magra y tierna, con filetes de gran untuosidad. En concreto, los filetes que se encuentran entre las costillas es el entrecot, pieza gruesa en el que se incluye la parte grasa. Se cocina a la plancha o parrilla.', '17,45 €', 'https://cdn.metro-group.com/es/es_pim_211636001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(874, 'METRO Chef lomo bajo vaca 5-6 kg pz al vacio', 'makro Chef es la Marca Makro en la que encontrarás todos los productos esenciales  para el uso diario en restaurantes y bares, desde productos frescos como verdura, carne o pescado; hasta lácteos, quesos, ahumados, conservas o aperitivos.', '16,45 €', 'https://cdn.metro-group.com/es/es_pim_211651001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(875, 'makro Chef Conejo eviscerado 1,2 - 1,4kg precio kg', 'La carne de conejo es muy valorada por sus características nutricionales y dietéticas. Es una carne magra con un bajo contenido de grasa.La carne de conejo es un alimento de gran versatilidad gastronómica y, por lo tanto, admite una amplia variedad de preparaciones culinarias. Se puede preparar asado, al horno, a la plancha, salteado, rehogado con verduras, estofado, cocido, marinado, guisado, confitado, frito...', '6,95 €', 'https://cdn.metro-group.com/es/es_pim_33107001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(876, 'METRO Chef secreto cerdo duroc vacío', 'Uno de los bocados más exquisitos del cerdo. Su grasa infiltrada lo convierte en una pieza con una increíble textura y súper jugoso.', '10,45 €', 'https://cdn.metro-group.com/es/es_pim_217788001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(877, 'METRO Chef solomillo vaca 2-2,4 kg al vacio', 'makro Chef es la Marca Makro en la que encontrarás todos los productos esenciales  para el uso diario en restaurantes y bares, desde productos frescos como verdura, carne o pescado; hasta lácteos, quesos, ahumados, conservas o aperitivos.', '25,95 €', 'https://cdn.metro-group.com/es/es_pim_211643001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(878, 'METRO Chef lomo bajo vaca porcionado 300 g', 'Corte de categoría extra. Carne limpia y sabrosa que se encuentra en la parte posterior del lomo y que se caracteriza por su aspecto jugoso y su infiltración de grasa. Ideal para plancha, freir, brasa, parrilla.', '17,45 €', 'https://cdn.metro-group.com/es/es_pim_217687001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(879, 'METRO Chef lomo bajo vaca 6-7 kg pz al vacio', 'makro Chef es la Marca Makro en la que encontrarás todos los productos esenciales  para el uso diario en restaurantes y bares, desde productos frescos como verdura, carne o pescado; hasta lácteos, quesos, ahumados, conservas o aperitivos.', '16,95 €', 'https://cdn.metro-group.com/es/es_pim_211652001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(880, 'makro Chef Filete añojo 1ºa 10ud al vacio precio kg', 'Filetes de añojo 1ºA de la marca MAKRO CHEF. La pieza de 1,2 kg de peso aproximado e incluye 10 filetes. Estos filetes de añojo se presentan envasados al vacío y refrigerados para conservar intactas todas sus propiedades. Carne de vacuno fresca de origen 100% nacional que cuenta con el certificado Global G.A.P. de \'GGN Ganadería Certificada\' que garantiza la máxima calidad en toda la cadena de valor del producto, desde la granja hasta nuestras tiendas. ¿Qué significa qué las carnes de vacuno de Makro lleven el sello GLOBAL G.A.P.? Qué en todo el ciclo de vida de ese producto se han respetado los máximos estándares de calidad. Los animales han sido criados de manera responsable y segura. Utilizando en su alimentación piensos vegetales, también certificados, y acompañados con un exhaustivo programa de salud animal y control sanitario en todo el ciclo. Desde la granja, hasta qué hoy lo encuentras en nuestras tiendas. ¿En qué referencias de carne encuentras el sello GLOBAL G.A.P.? En todas las referencias de vacuno nacional de las marcas MAKRO CHEF y MAKRO PREMIUM. ¿Quieres saber más? El tradicional compromiso de Makro con la calidad nos permite presumir de ser la primera marca en ofrecer una línea de carnes de vacuno de estas características para el sector HORECA.', '16,95 €', 'https://cdn.metro-group.com/es/es_pim_197225001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(881, 'METRO Chef Presa de cerdo de raza ibérica precio kg', 'Ingredientes para tu pasión. Productos líderes en calidad con características prácticas y productos, con un amplio surtido y envases de diferentes tamaños que se ajustan a las necesidades del cliente.', '24,95 €', 'https://cdn.metro-group.com/es/es_pim_90396001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(882, 'METRO Chef Lomo alto porcionado vaca 400 g vacío', 'Se trata de un corte con un alto grado de marmoleo de grasa. Esta característica le da un sabor intenso y representativo a esta pieza de vacuno.', '24,45 €', 'https://cdn.metro-group.com/es/es_pim_220834001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(883, 'METRO Chef Filete ternera 1ºa 10ud al vacio precio kg', 'Filetes de ternera 1ºA de la marca MAKRO PREMIUM. La pieza de 1,2 kg de peso aproximado incluye 10 filetes. Estos filetes de ternera se presentan envasados al vacío y refrigerados para conservar intactas todas sus propiedades. Carne de vacuno fresca de origen 100% nacional que cuenta con el certificado Global G.A.P. de \'GGN Ganadería Certificada\' que garantiza la máxima calidad en toda la cadena de valor del producto, desde la granja hasta nuestras tiendas.9 ¿Qué significa qué las carnes de vacuno de Makro lleven el sello GLOBAL G.A.P.? Qué en todo el ciclo de vida de ese producto se han respetado los máximos estándares de calidad. Los animales han sido criados de manera responsable y segura. Utilizando en su alimentación piensos vegetales, también certificados, y acompañados con un exhaustivo programa de salud animal y control sanitario en todo el ciclo. Desde la granja, hasta qué hoy lo encuentras en nuestras tiendas. ¿En qué referencias de carne encuentras el sello GLOBAL G.A.P.? En todas las referencias de vacuno nacional de las marcas MAKRO CHEF y MAKRO PREMIUM. ¿Quieres saber más? El tradicional compromiso de Makro con la calidad nos permite presumir de ser la primera marca en ofrecer una línea de carnes de vacuno de estas características para el sector HORECA.', '17,45 €', 'https://cdn.metro-group.com/es/es_pim_197086001001_03.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(884, 'METRO Chef lomo bajo vaca porcionado 200 g', 'Corte de categoría extra. Carne limpia y sabrosa que se encuentra en la parte posterior del lomo y que se caracteriza por su aspecto jugoso y su infiltración de grasa. Ideal para plancha, freir, brasa, parrilla.', '16,95 €', 'https://cdn.metro-group.com/es/es_pim_217690001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Carne', 'Makro'),
(885, 'METRO Chef Naranja de zumo calibre 6/7 caja 12,5kg .', 'Ingredientes para tu pasión. Productos líderes en calidad con características prácticas y productos, con un amplio surtido y envases de diferentes tamaños que se ajustan a las necesidades del cliente.', '13,99 €', 'https://cdn.metro-group.com/es/es_pim_35666001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(886, 'METRO Chef Aguacate premadurado calibre 14/16 caja 4 kg', 'Debido a la cremosidad de la pulpa que le confiere su riqueza en grasas, el aguacate se unta fácilmente, lo que lo convierte en una saludable mantequilla vegetal, alternativa excelente a las margarinas industriales.', '18,89 €', 'https://cdn.metro-group.com/es/es_pim_922974001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(887, 'METRO Chef limón calibre 4-5 bolsa 1,5 kg', 'Limón de primera con calibre 4/5 en malla de 1,5Kg METRO CHEF, ideal para hostelería.', '3,19 €', 'https://cdn.metro-group.com/es/es_pim_221667001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(888, 'METRO Chef Limón calibre 3/4 caja 6kg', 'Limon de primera con calibre 3/4 en caja de 6Kg MAKRO CHEF, ideal para hosteleria', '12,65 €', 'https://cdn.metro-group.com/es/es_pim_437554001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(889, 'METRO Chef Piña calibre 6 pieza 2kg', 'Piña variedad Gold, categoría I, calibre 6 y de origen Sudamérica, por piezas.', '3,19 €', 'https://cdn.metro-group.com/es/es_pim_91001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(890, 'METRO Chef Naranja de mesa malla 2kg', 'Naranja de mesa calibre 4/5 . Se presenta en una malla 2kg aproximado', '3,15 €', 'https://cdn.metro-group.com/es/es_pim_65605001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(891, 'METRO Chef freson caja 1 kg', 'Fresón especialmente seleccionado como ingrediente ya sea para platos dulces (postres) como salados. Textura ideal tanto para corte limpio como para triturado. Producto de alta calidad en origen y con certificado GLOBALG.A.P. SPRING.', '5,09 €', 'https://cdn.metro-group.com/es/es_pim_221666001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(892, 'METRO Chef Aguacate premium calibre 14 / 16 en tarrina de 1 kilo 4 piezas', 'Debido a la cremosidad de la pulpa que le confiere su riqueza en grasas, el aguacate se unta fácilmente, lo que lo convierte en una saludable mantequilla vegetal, alternativa excelente a las margarinas industriales.', '5,29 €', 'https://cdn.metro-group.com/es/es_pim_80710001002_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(893, 'METRO Chef Arandanos cubo 500 gramos', 'Arandanos atentamente seleccionados y envasados en formatode 500 gr. Se consume sobre todo en mermeladas, tartas o como acompañamiento de diversos platos.Antioxidante natural perfecto como complemento a todas tus comidas, snack ideal para niños y deportistas.', '5,35 €', 'https://cdn.metro-group.com/es/es_pim_193140001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(894, 'METRO Chef puré maracuyá bolsa 1 kg', 'Puré de maracuyá Metro Chef. Bolsa 1kg.  Tiene como ingrediente principal una variedad única, la Flavicarpa, de origen ecuatoriano. Esta variedad de fruta de la pasión procede de la costa noroeste de Ecuador, esta región cuenta con un clima ideal para cultivar maracuyá durante todo el año y un porcentaje de humedad especialmente alto.', '10,69 €', 'https://cdn.metro-group.com/es/es_pim_216202001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(895, 'METRO Chef Arándano tarrina 125g', 'Ingredientes para tu pasión. Productos líderes en calidad con características prácticas y productos, con un amplio surtido y envases de diferentes tamaños que se ajustan a las necesidades del cliente.', '1,45 €', 'https://cdn.metro-group.com/es/es_pim_46969001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(896, 'METRO Chef Uva roja sin pepitas tarrina 500g', 'Muy fácil de llevar, estos 500 gramos de uvas frescas, sabrosas y sin semilla son perfectas para cualquier ocasión y plan que el comensal prefiera.', '2,49 €', 'https://cdn.metro-group.com/es/es_pim_40847001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(897, 'makro Chef Pasa sin semilla , bolsa de 1 kg', 'Pasa sin semilla NO BRAND BOLSA 1 kg aproximado. Pasas negras sin semilla Bolsa 1kg', '8,89 €', 'https://cdn.metro-group.com/es/es_pim_281151001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(898, 'makro Chef Pasa sin semilla TARRINA 500 g', 'Pasa sin semilla MAKRO CHEF tarrina 500 g aproximado. Pasas sin semilla Tarrina 500 g', '4,59 €', 'https://cdn.metro-group.com/es/es_pim_114210001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(899, 'METRO Chef Naranja mesa calibre 5 saco 5kg', 'Ingredientes para tu pasión. Productos líderes en calidad con características prácticas y productos, con un amplio surtido y envases de diferentes tamaños que se ajustan a las necesidades del cliente.', '7,65 €', 'https://cdn.metro-group.com/es/es_pim_67795001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Frutas', 'Makro'),
(900, 'makro Chef ensalada mézclum bolsa 500g', 'Bolsa de 500g de ensalada mezclum con escarola rizada, brotes de lechuga roja, radicchio y mizuna, perfecta para combinar con quesos y carnes o mariscos. Combina la textura crujiente con la ternura, con distintos matices que combinan a la perfección para que acompañes tus recetas. Esta ensalada mezclub de Makro Chef viene cortada, limpia y preparada para comer.', '2,15 €', 'https://cdn.metro-group.com/es/es_pim_80666001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(901, 'METRO Chef Lechuga iceberg caja contiene 10ud', 'Características: el tallo tiene en su inicio forma de disco, del que surgen las hojas formando rosetas que posteriormente se acogollan. Las lechugas tipo Iceberg forman cogollos esféricos parecida a la col. Su ventaja es que sus hojas gruesas permanecen firmes durante bastante tiempo después de haber sido recolectada. Estacionalidad: La mejor época de la lechuga es la primavera (aunque depende mucho de la variedad), pero realmente podemos encontrarla en cualquier época del año. Propiedades nutricionales: Aporta mayoritariamente agua y cantidades mucho menores de hidratos de carbono y proteínas, por lo que resulta poco energética, aunque constituye un alimento rico en vitaminas, sales minerales y fibra. Es la verdura más rica en aportes de nutrientes. En cuanto a vitaminas, destaca la presencia de vitamina A, vitamina C y betacaroteno o provitamina A. Usos culinarios: Utilizada principalmente en ensaladas y en aperitivos.', '6,75 €', 'https://cdn.metro-group.com/es/es_pim_34284001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(902, 'METRO Chef Cebolla guisos Calibre 90/110 saco 25kg', 'Cebolla Variedad Guisos Categoría I Calibre 70/90 Origen España Por saco de 25 Kg', '26,25 €', 'https://cdn.metro-group.com/es/es_pim_41687001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(903, 'METRO Chef Tomate beef Calibre G caja 6kg', 'Tomate Variedad Beef Calibre G Categoria I Origen España Caja', '7,49 €', 'https://cdn.metro-group.com/es/es_pim_253162001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(904, 'Clemente Jacques chipotle adobado 2,8kg', 'Nos especializamos en la importación y distribución de una amplia gama de marcas de alta calidad. En Importaciones Cuesta estamos comprometidos con proporcionar los mejores ingredientes que le darán la oportunidad de descubrir los sabores únicos y auténticos de México e Italia.', '16,25 €', 'https://cdn.metro-group.com/es/es_pim_196350001001_02.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(905, 'METRO Chef Cebollino bandeja 125g', 'Sus hojas picadas sobre sopas y cremas realzan su sabor. Aromatiza ensaladas, crudités y revueltos.', '2,49 €', 'https://cdn.metro-group.com/es/es_pim_6346001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(906, 'makro Chef Rúcula selvatica tarrina 450g .', 'Rúcula selvatica MAKRO CHEF tarrina 450g aprox.. ENSALADAS.', '5,32 €', 'https://cdn.metro-group.com/es/es_pim_29835001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(907, 'METRO Chef Albahaca bandeja 125g .', 'Ideal para dar sabor a ensaladas, pastas y pizzas. Pruébala con pescados, carnes y salsas.', '3,49 €', 'https://cdn.metro-group.com/es/es_pim_22330001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(908, 'METRO Chef Tomate rojo caja 7kg', 'Tomate rojo origen España. Categoría I, caja 7 kg. Los mejores productos de marca propia para su negocio de hostelería.', '8,79 €', 'https://cdn.metro-group.com/es/es_pim_392054001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(909, 'METRO Chef cebolla morada especial decoración calibre 60/80 saco 5kg', 'La variedad de cebolla roja o morada está indicada para decorar tus elaboraciones. Gracias a su potente sabor y su picante, darás un toque diferenciador a tus platos. Calibre de 60/80 y en formato saco de 5kg.', '8,99 €', 'https://cdn.metro-group.com/es/es_pim_8396001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(910, 'makro Chef Cebolla guisos Calibre 70/90 saco 10kg', 'Cebolla Variedad Guisos Categoría I Calibre 70/90 Origen España Por saco de 10 Kg', '13,05 €', 'https://cdn.metro-group.com/es/es_pim_54853001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(911, 'METRO Chef pimiento pequeño freír dulce bolsa 1 kilo', 'Perfecto para Tapas, Menus o como guarnición. Mejor marca propia para su negocio', '7,69 €', 'https://cdn.metro-group.com/es/es_pim_217875001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(912, 'METRO Chef Champiñón Calibre 40/60 caja 2,5kg', 'CHAMPIÑON PIE ENTERO CATEGORIA I ORIGEN ESPAÑA CAJA 3 KILOS', '8,69 €', 'https://cdn.metro-group.com/es/es_pim_747539001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(913, 'METRO Chef Zanahoria Calibre 35/45 bolsa 5kg', 'Rica en potasio, fósforo y betacaroteno, la zanahoria es un excelente vigorizante para el organismo. Es la base para preparar todo tipo de platos, ensaladas, postres y zumos. Disponible 12 meses.', '4,99 €', 'https://cdn.metro-group.com/es/es_pim_815001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(914, 'METRO Chef Hierbabuena bandeja 125g', 'Ideal para postres, bebidas y cócteles. Exquisita en el aderezo de ensaladas, carnes, arroces y verduras.', '2,95 €', 'https://cdn.metro-group.com/es/es_pim_946244001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(915, 'METRO Chef cebolla morada especial decoración calibre 60/80 malla 1kg', 'Esta cebolla roja tiene un sabor picante intenso que la hace estupenda para decorar tus platos, así les darás un toque de color y de sabor. Calibre de 60/80 y en formato malla de 1kg.', '1,99 €', 'https://cdn.metro-group.com/es/es_pim_22415001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(916, 'METRO Chef Menta fresca mixta bandeja 125g', 'Perfecta para infusiones, postres y coctelería, aporta un sabor fresco a carnes y ensaladas.', '2,79 €', 'https://cdn.metro-group.com/es/es_pim_35696001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Verduras', 'Makro'),
(917, 'makro Chef Corvina 3-4 Kg de Cría origen España', 'Corvina REX Frescamar es una especie tradicional del Mediterráneo que resulta perfecta para una dieta sana y equilibrada, pues su carne magra posee un alto contenido en proteínas de alto valor biológico, y además es bajo en grasa, y fuente de fósforo y potasio. Cultivada en nuestras costas, las pescas se realizan diariamente asegurando así su llegada al punto de venta con la mayor frescura. Con un sabor exquisito y delicado, se trata de un pescado apto para múltiples elaboraciones (al horno, a la plancha, en ceviche, en sushi…), y muy versátil en cuanto a cortes (filetes, rodajas, porciones...).', '10,95 €', 'https://cdn.metro-group.com/es/es_pim_53429001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Pescados y mariscos', 'Makro'),
(918, 'METRO Chef ostra claire Nr. 2 de Cría origen Francia caja 18 pzas', 'Ostra con un sabor delicado, es muy carnosa, de carne firme y crujiente, de color marfileño, con un sabor pronunciado y persistente.', '15,90 €', 'https://cdn.metro-group.com/es/es_pim_201830001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Pescados y mariscos', 'Makro'),
(919, 'Bogavante 0,4-0,6 Kg origen Canada', 'El bogavante es un alimento muy rico en minerales, entre los que podemos destacar el yodo (ayuda a procesar los carbohidratos, fortalecer la piel, el cabello y las uñas), zinc (ayuda al proceso de crecimiento, es beneficioso para el sistema inmunitario y es beneficioso para la fertilidad del hombre), y hierro (útil a la hora de prevenir la anemia ferropénica).', '19,45 €', 'https://cdn.metro-group.com/es/es_pim_160584001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Pescados y mariscos', 'Makro'),
(920, 'Cola de Rape blanco 2-4 Kg FAO 27 Atlántico Noreste', 'El rape pescado blanco de escaso aporte calorico que  admite múltipes preparaciones. Se puede utilizar de infinitas maneras, como cualquier pescado (empanado, gratinado, horneado), en crema, cóctel, incluso como acompañamiento de otros platos como ensaladas, potajes, con frutas', '16,95 €', 'https://cdn.metro-group.com/es/es_pim_26701001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Pescados y mariscos', 'Makro'),
(921, 'Rape cola bolsa 2-4 kg FAO 27', 'Es un pescado de carne firme y textura suave, apreciado por su sabor delicado y versatilidad culinaria. Ideal para cocinar a la plancha, al horno o en guisos, la cola de rape se destaca por su capacidad para absorber sabores y mantener su jugosidad. Es una excelente opción para quienes disfrutan de pescados blancos de alta calidad y frescura.', '16,95 €', 'https://cdn.metro-group.com/es/es_pim_221016001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Pescados y mariscos', 'Makro'),
(922, 'Atún lomo vacío 2-6kg FAO77 atlántico este central', 'Es un pescado azul con gran aporte en Omega-3, vitaminas A y D y minerales como potasio, hierro, yodo, fósforo y magnesio', '13,95 €', 'https://cdn.metro-group.com/es/es_pim_173826001001_02.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Pescados y mariscos', 'Makro'),
