(939, 'aro salmón ahumado 1,2 kg aproximado', 'Plancha de salmón ahumado ARO. Peso variable. Salmón procedente de acuicultura, cría en Noruega. Producido en España siguiendo el proceso de ahumado tradicional. Libre de conservantes.  Se escoge el mejor salmón y se cura con sal con un ahumado tradicional ligero aportando un inconfundible aroma y sabor suaves. La plancha de salmón ahumado está precortada por lo que facilita su uso y ahorra tiempo de manipulación y preparación en la cocina. Únicamente hay que abrir y está lista para consumir o para usar como ingrediente versatil en multitud de platos (ensaladas, empanadas, pizzas o canapés). El envasado al vacío permite mejorar la vida útil y favorece la conservación manteniendo las características organolécticas para poder disfrutar de los diferentes matices del ahumado tradicional, conservando los aromas característicos de las maderas nobles.', '28,69 €', 'https://cdn.metro-group.com/es/es_pim_191795001001_01.png?format=jpg&quality=80&dpi=72&w=144&h=144', 'Pescados y mariscos', 'Makro'),
